import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";
 
import DadosPessoais from "./pages/dadosPessoais";
import Contato from "./pages/contatoEnder";
import cu from "./main";

function App() {
  return (<>
    <Router onLoad>
      <Routes>
        <Route path="/" element={<DadosPessoais/>}/>
        <Route path="/cont" element={<Contato/>}/>
      </Routes>
    </Router>
    </>
  );
}
export default App;
